//import Auth from './components/Auth.js'
//import Profile from './components/Profile.js'
//import Public from './components/Public.js'

function App() {
  return (
    <div className="App">
      <img src={logo} alt="Ann's Kitty-love logo" />
    <h1>Rate the Review</h1>
    {/* <Navbar /> */}

    <Switch >

      <Route exact path="/">
        {/* <Auth /> */} Auth Page goes here
      </Route>

      <Route path="/profile">
        {/* <Profile /> */} Profiel Page goes here
      </Route>

      <Route path="/public">
        {/* <Public /> */} Publick page goes here
      </Route>

    </Switch>
    </div>
  );
}

export default App;
